import * as React from 'react';
import PropTypes from 'prop-types';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col'
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import RefreshIcon from '@mui/icons-material/Refresh';
import CircularProgress from '@mui/material/CircularProgress';
import DeleteIcon from '@mui/icons-material/Delete';
import TextField from '@mui/material/TextField';
import { useSelector, useDispatch } from 'react-redux'
import { getCartItems, removeItemFromCart } from '../../reducers/cartReducer'


const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogTitle-root': {
    background: "#00",
  },
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),
  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),
  },
}));

const BootstrapDialogTitle = (props) => {
  const { children, onClose, ...other } = props;

  return (
    <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
      {children}
      {onClose ? (
        <IconButton
          aria-label="close"
          onClick={onClose}
          sx={{
            position: 'absolute',
            right: 8,
            top: 8,
            color: (theme) => theme.palette.grey[500],
          }}
        >
          <CloseIcon />
        </IconButton>
      ) : null}
    </DialogTitle>
  );
};

BootstrapDialogTitle.propTypes = {
  children: PropTypes.node,
  onClose: PropTypes.func.isRequired,
};

export default function CustomizedDialogs({ open, handleClose }) {


  const dispatch = useDispatch()

  const { cart_items, delIsLoading } = useSelector(
    (state) => state.cart
  )

  const removeItem = (id) => {
      dispatch(removeItemFromCart(id))
  }

  React.useEffect(() => {
       dispatch(getCartItems())
    }, [cart_items]);


  return (
    <div>
      <BootstrapDialog
        maxWidth='md'
        scroll='paper'
        onClose={handleClose}
        aria-labelledby="customized-dialog-title"
        open={open}
      >
        <BootstrapDialogTitle id="customized-dialog-title" onClose={handleClose}>
           Cart
        </BootstrapDialogTitle>
        <DialogContent dividers>
          {  delIsLoading && 
             <div style={{ width: "100%", height: "100%", zIndex: "10"}} className="bg-white position-absolute">
             <CircularProgress className="text-center" color="primary" style={{ width: '20%', height: '20%'}} /> 
             </div> 
           }
          <Container  style={{ overflow: "scrollY", maxHeight: "300px"}}>
           { cart_items?.length == 0 ?  
            <img style={{width: "50%", height: "50%"}} className="position-relative center d-flex" src="sport_images/empty_cart.png" /> 
             : cart_items.map((item, index) => ( 
            <>
            <Row md={12} className="py-2 text-center m-auto">
            <Col md={3}>
            <img style={{ maxWidth: "100px", maxHeight: "100px" }} className='position-relative' src={`sport_images/${item.product.image}`} alt="logo"/>
            </Col>
            <Col md={3} className="m-auto">
                {item.product.desc}
            </Col>
            <Col md={2} className="m-auto">
                {item.product.price}$
            </Col>
            <Col md={2} className="m-auto">
            <TextField
          style={{ width: '50%'}}
          defaultValue={item.quantity}  
          InputProps={{ inputProps: { min: 0} }}
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
          variant="standard"
        />             
           </Col>
             <Col md={2} className="m-auto d-flex">
             <IconButton> <RefreshIcon /> </IconButton> <IconButton>  <DeleteIcon onClick={() => removeItem(item._id)} style={{color: "red",}} /> </IconButton> 
             </Col>
          </Row>
          { cart_items?.length > 1 && index != cart_items?.length-1  ? <hr/> : "" }
          </> ))
          }
         </Container>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={handleClose}>
            Save changes
          </Button>
        </DialogActions>
      </BootstrapDialog>
    </div>
  );
}
